import Avatar from "./Avatar"
import axios from 'axios';
import { useState, useEffect } from "react";

const Home = () => {
    const [userDetails, setUserDetails] = useState({});

    const getUserDetails = async (id) => {
        try {
          const response = await axios.get(`https://reqres.in/api/users/${id}`);
          return await response;
        } catch (error) {
          console.error(error)
        }
      }

      const handleUserDetails = async (id) => {
        const data = await getUserDetails(id);

        if (data.data.message) {
          console.log(`${data}`)

        }
      }


    return (
        <>
            <button onClick = {handleUserDetails('1')} >1</button>
            <button onClick = {handleUserDetails('2')}>2</button>
            <button onClick = {handleUserDetails('3')}>3</button>
            <button onClick = {handleUserDetails('100')}>100</button>
            <Avatar userDetails={{userDetails}}/>
        </>
    )
}

export default Home
